import React from "react";
import {deleteUser} from "../../Services/UserService.js";
export default function ProductListingsListItem(props){

    console.log(props);
    const deleteCurrUser = () =>{
        deleteUser(props.objectId);
    }

    return (
        <div>
            Name: {props.username}
            <br></br>
            Email: {props.email}
            &nbsp;<button onClick={deleteCurrUser}>Delete this user</button>
        </div>
    )
}
